import React, { Component } from "react";
import Chart from "react-apexcharts";

class Column extends Component {
  state = {};
  render() {
    return (
      <Chart
        options={props.options}
        series={props.series}
        type="bar"
        width="500"
      />
    );
  }
}

export default Column;
